  JWILLIAMS, Wilfrid Maurice Chalk and BARNES, Kathleen Penelope (Penny)
  JWILLIAMS, Anthony Owen (Tony) and HARLEY, Caroline May
  01> WILLIAMS, Anthony Owen (Tony) m on 08.01.1972 to HARLEY, Caroline May
  b 05.04.1939
  b 08.01.1951
  Tony b. at Topsham, Devon, England and m. at St Andrew's Church, Brisbane. Caroline, d/o Stan and
  Leah Harley. Address: 58 Railway Terrace, Murarrie 4172, Brisbane, Qind, Australia.
  Tony came to New Zealand in 1946. He attended primary schools at Topsham, Wanganui and Mangaweka,
  then went to Wanganui Technical College as a boarder. Leaving school in 1956, he worked on various
  farms in North and South Islands and then took a position in the liquor department of the Farmers
  Co-op Trading Co in Taihape (1966-69). He went to Australia. in 1969 and worked as storeman/ driver
  with McWilliams Wines in Brisbane remaining with them for 22 years. His interests include classical
  music, the arts and gardening.
  After leaving school Caroline worked for the public service in Brisbane in the Library Department.
  She is a qualified massage therapist, and artist and enjoys cooking, ten-pin bowling and writing
  poetry.
  01> WILLIAMS, Kathleen Penelope
  b 10.04.1976
  Kathleen b. at Brisbane, Australia.
  Kathleen attended Murarrie Primary School for 8 years then won a scholarship to Moreton Bay
  College. She was Dux of her school and in four successive she won the Woodwind Trophy. She is a
  clarinetist and plays in the Queensland Youth Orchestra, the Cleveland Symphony Orchestra and
  also the Chamber Orchestra with the Conservatorium of Music. She is also studying the piano.
  She has also won a number of gymnastics competitions.
  62> WILLIAMS, Maurice Stanley
  b 23.04.1979
  Maurice b, at Brisbane, Australia.
  Maurice attended Murarrie Primary School where he played the trumpet in the school band and won
  the Trumpet Trophy in three successive years. He is also a gymnast.
  02> WILLIAMS, Maurice Miles
  b 27.08.1943
  Miles b. at Palmerston North. Address: 611 Richmond Street, Thames.
  Miles lived in England from 1943 to 1946. He attended primary schools at Wanganui and Mangaweka,
  then went to Wanganui Technical College as a boarder. In 1961 he went to Christchurch to work with
  the public accountancy firm of J W K Lawrence & Co, attending Canterbury University part-time. In
  1972 he moved to Thames and joined public accountants Gary C Meek where he is now employed. His
  other interests include fishing and gardening.
  02> WILLIAMS, Sybil Mary m on 04.12.1940 to WOODS, Samuel Edward
  b 07.07.1914
  b 13.07.1910
  Sybil b. at Wanganui. Samuel, s/o the Right Rev ES Woods (Bishop of Lichfield, England) and Clemence
  Barclay, b. at Cromer, England. Address: 18 Wren Street, Parkwood, Waikanae 6454.
  Sybil's mother was a very well educated woman, widely read and a fluent speaker of French and German.
  She also played the piano very well and enjoyed writing plays for the children to act at "Raumai", Mrs
  Ramsay's private school which Sybil attended until the age of ten. Here she studied French, elocution
  and the piano and developed a love of English literature. From 1925 to 1932 Sybil attended Wanganui
  Girls' College where she was Dux of the school in 1930 and Head Prefect in 1931 and 1932. Miss C M
  Cruickshank, who was headmistress until her retirement in 1931, persuaded Sybil and four other girls to
  return to the school for a third sixth form year. None of these girls could afford to go to University
  and the Training Colleges had closed during the Depression. So these girls studied and sat for the
